public class Day2_2 {
    private static String[] instructions = {"",
            "",
            "",
            "",
            ""};
    private static int currentKey = 53;

    public static void main(String[] args) {
        for (String instruction : instructions) {
            for (char c : instruction.toCharArray()) {
                switch (c) {
                    case 'L':
                        if (currentKey != 49 && currentKey != 50 && currentKey != 53 && currentKey != 58 && currentKey != 61)
                            currentKey--;
                        break;
                    case 'R':
                        if (currentKey != 49 && currentKey != 52 && currentKey != 57 && currentKey != 60 && currentKey != 61)
                            currentKey++;
                        break;
                    case 'U':
                        if (currentKey != 49 && currentKey != 50 && currentKey != 52 && currentKey != 53 && currentKey != 57)
                            currentKey -= currentKey == 51 ? 2 : currentKey == 61 ? 2 : 4;
                        break;
                    case 'D':
                        if (currentKey != 53 && currentKey != 58 && currentKey != 61 && currentKey != 60 && currentKey != 57)
                            currentKey += currentKey == 49 ? 2 : currentKey == 59 ? 2 : 4;
                        break;
                }
            }
            char correctKey = (char) (currentKey > 57 ? currentKey+7 : currentKey);
            System.out.print("[" + correctKey + "]");
        }
    }
}